import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import About from './About';

function App() {
  return (
    <div>
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/" element={<About/>}/>
        </Routes>
      </div>
    </BrowserRouter>
  </div>
  );
}

export default App;
